/**
Initial System Configuration for a Molajo Distribution

Assumption: Each catalog_types entry has been defined as a model in the core files and the
 initial parameters and parameter values are defined, including all types of and each specific item
 of data, ranging from applications and extension instances to users and group, along with
 categories and tags, as well as resource items in sample data. Across that range, testing to
 ensure the specificity expected works has been completed.

1. Planning:

    Actions
    Roles
    Groups
    View Access
    How best to handle "own"

Actions are applied to any and all data within the system

1 - Login
2 - Create
3 - Read
4 - Update
5 - Publish
6 - Delete
7 - Administer

Roles implement defaults or starting values from which changes can be made

Note: 100% of View Access is defined with each Catalog Entry using a View Group

3000 - CategoriesSystem   - All View Defaults set to Public - lower level security can be added to prevent view

1 - 10 - Administrator: Site  - Administrator (9)
2 - 11 - .. Administrator: Application - Administrator (9)
3 - 12 - .. .. Developer: Extensions - Developer (8)
4 - 13 - .. .. Manager: Users and Groups - Manager (7)
5 - 14 - .. .. Publisher: Categories, Static Text, Publish ability - Editors (5) and Publisher (6)
6 - 15 - .. .. .. Author: Create, Edit-own, Resources, Tags, Media - Authors (4)
7 - 16 - .. .. .. .. Member: Friends - Registered (3)
8 - 17 - .. .. .. .. .. Public: Respond (1)

Given the roles and actions defined above, the basic group structure is made

1  17 Public (1)
2   3 -- Guest (2)
4  11 -- Registered (3)
5  10 -- -- Authors (4)
6   9 -- -- -- Editors (5)
7   8 -- -- -- -- Publisher (6)
12 16 -- -- Manager (7)
13  9 -- -- -- Developer (8)
14 15 -- -- -- -- Administrator (9)

Combining various types of view permissions results in a basic View Access list:

1 Public (1)
2 Guest (2)
3 Registered (3)
4 Special (4,7)
5 System (8)

Roles (Catalog ID, Category ID, Action ID, Group ID)
*/

