/** 29. Insert Catalog Entries for Articles   */
INSERT INTO `molajo_catalog`(`id`, `catalog_type_id`, `source_id`, `routable`, `menuitem_type`, `sef_request`, `redirect_to_id`, `view_group_id`, `primary_category_id`, `tinyurl`)
	SELECT NULL as `id`, `a`.`catalog_type_id`, `a`.`id` as `source_id`, `b`.`routable`, '' as `menuitem_type`,
		CONCAT(b.slug,'\\',a.alias) as `sef_request`,
		0 as `redirect_to_id`, 1 as `view_group_id`, b.`primary_category_id`, '' as `tinyurl`
		FROM `molajo_content` a,
			`molajo_catalog_types` b
		WHERE a.catalog_type_id = 10000
		AND b.id = a.catalog_type_id

